import React from "react";
import { Link } from "react-router-dom";
import "./campsite.css";

const Campsite = () => {
  return (
    <div className="campsite--container">
      <ul className="campsite--ul">
        <li>
          <Link to="/inside-tent" className="arrow up">
            Check tent
          </Link>
        </li>
        <li>
          <Link to="/house" className="arrow left">
            House
          </Link>
        </li>
        <li>
          <Link to="/start" className="arrow diagonally-left--down">
            Return
          </Link>
        </li>

        <li>
          <Link to="/forest" className="arrow down">
            Go to forest
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Campsite;
